function initData() {
    return usersDataBase.map(e => {
        e.image = Math.floor(Math.random() * 2) === 1 ? getUserImage2(Math.floor(Math.random() * 100) + 1) : null;
        return e;
    })
}

const usersData = initData();

export function getUserImage(num = 1) {
    if (num > 14) num = 14;
    if (num < 1) num = 1;
    return `https://keenthemes.com/metronic/preview/demo3/assets/media/users/100_${num}.jpg`
}

export function getUserImage2(num = 1, type) {
    if (num > 100) num = 100;
    if (num < 1) num = 1;
    if (type !== 'men' || type !== 'women') type = Math.floor(Math.random() * 2) === 1 ? 'men' : 'women';
    return `https://randomuser.me/api/portraits/${type}/${num}.jpg`
}

export default function getUsers(numberOfUsers = 10) {
    return randomElements(usersData, numberOfUsers);
}

export function getUser() {
    const user = getUsers(1);
    if (user === false) return user;
    return user[0];
}
